experience.description:
Соблюдал установленные правила безопасности, а также утвержденные инструкции по вождению электротранспорта;
Организовывал приёмку состава и его сдачи;
Проверял функциональность тормозной системы;
Осуществлял мероприятия по перевозке пассажиров в соответствии с установленным графиком перемещения.
Своевременно реагировал на любую информацию, поступающую по системе экстренной связи от пассажиров;
Выполнял контроль технического состояния вагонов, а также кабин водителя.
